import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the sort select (Price Sort Filter) to be visible
    await page.waitForSelector('#sortSelect', { timeout: 5000 });

    // Click the sort dropdown and select "Price: Low to High"
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for the products grid/list to update (wait for any product card to be visible)
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after applying the price sort filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_sort_applied.png'));

    // Extract the first 3 product titles and prices to verify sorting
    const products = await page.$$eval(
      '.product-card, .product-card-list',
      nodes => nodes.slice(0, 3).map(node => {
        const title = node.querySelector('.product-title')?.textContent?.trim() || '';
        const priceText = node.querySelector('.product-price')?.textContent || '';
        // Extract first price as float
        const match = priceText.match(/\$([\d,.]+)/);
        const price = match ? parseFloat(match[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    return {
      success: true,
      action: "Applied Price: Low to High sort filter and verified product order",
      extractedData: {
        firstThreeProducts: products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
